    /**
     * msg : 请求成功
     * code : 200
     * data : {"name":"检查问讯APP-快捷用语-三亚凤凰边检","version":"V1.0","typeInfo":{"typeName":"三亚边检-检查询问-快捷用语-无选项版","typeId":71,"typePid":0,"typeLevel":1,"sort":0,"next":[{"typeId":78,"typePid":71,"typeName":"快捷用语","typeLevel":2,"sort":3,"next":[]}]},"questionInfo":[{"qId":247,"typeId":78,"content":"边检机关根据《中华人民共和国出境入境管理法》第六十六条规定，对出入境人员进行人身检查，请您配合。","sort":0},{"qId":248,"typeId":78,"content":"边检机关根据《中华人民共和国出境入境管理法》第六条规定，对出入境人员及其携带的行李物品包括手机等电子产品实施检查抽查，请您配合。","sort":0},{"qId":249,"typeId":78,"content":"这里是边防检查执勤现场，为维护口岸限定区域管理秩序，不准拍照摄像，违者将按照《中华人民共和国出境入境管理法》第八十二条规定实施处罚，请您配合。","sort":0},{"qId":250,"typeId":78,"content":"恐怖主义是当今世界公害，厉害打击恐怖主义暴力恐怖活动是国际社会的共同责任。为预防和打击恐怖主义，许多国家采取强化入境检查的措施。根据《中华人民共和国出境入境管理法》的有关规定，中国出入境边防检查机关依法对入境人员携带的可疑物品包括电子设备进行检查，目的是有效防范境外暴力恐怖分子危害广大群众的生命安全和社会稳定，这与大多数国家的做法是一致的。\r\n中国出入境边防检查机关将一如既往严格依法依规实施出入境检查，坚决维护国家安全和社会稳定，确保出入境人员的人身财产安全，同时继续为外国来华人员提供必要的出入境便利，依法保护出入境人员的合法权益。","sort":0},{"qId":251,"typeId":78,"content":"感谢您的配合，欢迎您来到三亚！","sort":0}],"translationInfo":[{"traId":7312,"qId":247,"laId":3,"content":"According to Article 66 of Order of the President of the People's Republic of China, the border control authorities shall carry out physical examination for entry-exit personnel. Please cooperate."},{"traId":7313,"qId":247,"laId":18,"content":"出入国検査機関は『中華人民共和国出国入国管理法』第六十六条の規定に基づき、出入国者に対して人身検査を行います。ご協力ください"},{"traId":7314,"qId":247,"laId":19,"content":"변방검사기관은 「중화인민공화국 출입국관리법」 제66조의 규정에 따라 출입국 인원에 대한 몸 검사를 실시합니다. 협조 부탁드립니다. "},{"traId":7315,"qId":247,"laId":24,"content":"Орган по пограничному досмотру согласно 66-й статье «Закона КНР о управлении въездом и выездом», выполняет проверку лиц, пересекающих границу, поддерживайте пожалуйста."},{"traId":7316,"qId":248,"laId":3,"content":"According to Article 6 of Order of the President of the People's Republic of China,the border control authorities shall carry out spot checks on entry-exit personnel and their luggage, including mobile phones and other electronic products. Please cooperate."},{"traId":7317,"qId":248,"laId":18,"content":"出入国検査機関は『中華人民共和国出国入国管理法』第六十六条の規定に基づき、出入国者及び携帯電話などの電子製品を含む手荷物に対して検査や抜き取り検査を行います。ご協力ください。"},{"traId":7318,"qId":248,"laId":19,"content":"변방검사기관은 「중화인민공화국 출입국관리법」 제6조의 규정에 따라 출입국 인원 및 휴대 수하물, 휴대폰 등 전자제품을 포함하여 무작위 검사를 실시합니다. 협조 부탁드립니다. "},{"traId":7319,"qId":248,"laId":24,"content":"Орган по пограничному досмотру согласно 6-й статье «Закона КНР о управлении въездом и выездом», выполняет проверку лиц, пересекающих границу, и их багажей, в том числе включая мобильный телефон и другие электронные продукции, поддерживайте пожалуйста."},{"traId":7320,"qId":249,"laId":3,"content":"This is the due scene of border inspection and enforcement. To maintain order management of the limited region at the port, no photos or videos are allowed. The violators will be punished according to Article 82 of the Order of the President of the People's Republic of China. "},{"traId":7321,"qId":249,"laId":18,"content":"ここは出入国検査の勤務現場です。国境ゲート限定区域内の管理秩序を守るために、写真やビデオ撮影を禁止しています。違反者には『中華人民共和国出国入国管理法』第八十二条の規定に従って処罰が課せられます。ご協力ください。"},{"traId":7322,"qId":249,"laId":19,"content":"이곳은 변방검사 근무현장입니다. 제한구역의 관리 질서를 유지하기 위해 사진이나 동양상 촬영이 금지됩니다. 위반시 「중화인민공화국 출입국관리법」 제82조의 규정에 따라 벌칙금이 부과될 수 있습니다. 협조 부탁드립니다. "},{"traId":7323,"qId":249,"laId":24,"content":"Это дежурное место для пограничного досмотра, для того, чтобы сохранить порядок в предельной зоне порта, не позволяет фотографировать, будет согласно 82-й статье «Закона КНР о управлении въездом и выездом» наказывать нарушителей, поддерживайте пожалуйста."},{"traId":7324,"qId":250,"laId":3,"content":"Terrorism is a public hazard in today's world. It is the common responsibility of the international community to combat terrorism and violent terrorist activities. To prevent and combat terrorism, many countries have adopted the measure of strengthening immigration inspections. According to the relevant provisions of the Order of the President of the People's Republic of China, China Immigration Inspection shall inspect suspicious articles carried by entry-exit personnel, including electronic equipment, so as to effectively prevent foreign violent terrorists from endangering the lives and social stability of the masses, which is consistent with the practice of most countries.  China Immigration Inspection shall continue to carry out exit and entry inspection in strict accordance with the law and regulations,resolutely safeguard national security and social stability,and ensure the personal and property safety of entry-exit personnel.At the same time, it will continue to provide necessary entry-exit facilities for foreign visitors to China,and protect the legitimate rights and interests of entry-exit personnel according to law."},{"traId":7325,"qId":250,"laId":18,"content":"「テロリズムは現在の世界の公害であり、テロリズムによるテロ活動に厳しい打撃を与えるのは、国際社会の共同責任です。テロリズムの防止と取締を図るために、多くの国が入国検査を強化しています。海外の暴力テロリストが広範な大衆の生命の安全と社会の安定に危害を加えることを効果的に防ぐために、『中華人民共和国出国入国管理法』の関連規定に従い、中国出入国検査機関は法により入国者が所持する電子設備を含む不審物に対して検査を行います。これは世界大多数の国のやり方と一致しています。 中国出入国検査機関はこれまでと同じように厳格に法により出入国検査を実施し、国家の安全と社会の安定を断固として守り、出入国者の人身と財産の安全を確保するとともに、訪中外国人に必要な出入国上の便利を提供し、法により出入国者の合法的権益を保護します。」"},{"traId":7326,"qId":250,"laId":19,"content":"테러행위는 세계적 공해이며 테러분자의 폭력 테러 활동을 엄격히 타격하는 것은 국제사회의 공동의 책임입니다. 테러행위를 타격하기 위해 많은 국가들에서는 입국 심사 강화 조치를 취하고 있습니다. 「중화인민공화국 출입국관리법」의 규정에 근거하여, 중국 출입국 변방검사기관은 법에 따라 입국자가 휴대한 의심되는 물품으로, 전자설비를 포함하여 필요한 검사를 실시하는바, 그 취지는 해외 폭력 테러분자들의 위험으로부터 무고한 대중의 생명 안전과 사회 안정을 보호하기 위한 것으로, 이는 대부분 국가의 조치와도 일치합니다.  중국 출입국 변방검사기관은 시종일관 법에 따라 출입국 검사를 실시하여, 국가 안전과 사회 안정을 견결히 수호함으로써, 출입국 인원의 생명과 재산 안전을 보호함과 동시에 중국을 방문하는 외국인에 대하여 필요한 출입국 편리를 제공하고, 법에 따라 출입국 인원의 합법적 권익을 보호할 것입니다. "},{"traId":7327,"qId":250,"laId":24,"content":"В сегодняшнем мире терроризм является общественным злом, серьезная борьба с террористической деятельностью терроризма является солидарной ответственностью международного общества. Для того, чтобы предотвратить и бороться с терроризмом, многие страны приняли сильные меры по въездному контролю. Согласно соответствующим положениям «Закона КНР о управлении въездом и выездом», орган Китая по пограничному досмотру выполняет проверку взятых подозрительных вещей (пример электронные аппаратуры) въезжающими лицами, с целью предотвращает то, что иностранные террористы не вредили безопасности жизни широких масс и социальной стабильности.  Орган Китая по пограничному досмотру будет согласно законам и правилам как и прежде строго выполнять выездной и въездной контроль, твердо защищать государственную безопасность и социальную стабильность, обеспечивать безопасность человеческой жизни и имущества лиц, пересекающих границу, в то же время оказывать иностранцам необходимое удобство пересечения границы, согласно законам защищать законные права и интересы лиц, пересекающих границу. "},{"traId":7328,"qId":251,"laId":3,"content":"Thank you for your cooperation. Welcome to Sanya!"},{"traId":7329,"qId":251,"laId":18,"content":"ご協力ありがとうございます。三亜にようこそ。"},{"traId":7330,"qId":251,"laId":19,"content":"협조에 감사드립니다, 싼야 방문을 환영합니다! "},{"traId":7331,"qId":251,"laId":24,"content":"Спасибо вам за поддержку, добро пожаловать в Санья! "}]}
     */

